        macro_comment:'',
        fieldname:'',
        fieldicon:'',
        explanation_d:'<SPAN style=\"FONT-SIZE: 12pt; FONT-FAMILY: \'Arial\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'\"><FONT color=#fd0202><FONT color=#000000><FONT color=#fd0202>\r\n<P><SPAN class=Apple-style-span style=\"WORD-SPACING: 0px; FONT: medium \'Times New Roman\'; TEXT-TRANSFORM: none; COLOR: rgb(0,0,0); TEXT-INDENT: 0px; WHITE-SPACE: normal; LETTER-SPACING: normal; BORDER-COLLAPSE: separate; orphans: 2; widows: 2; -webkit-border-horizontal-spacing: 0px; -webkit-border-vertical-spacing: 0px; -webkit-text-decorations-in-effect: none; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px\"><SPAN class=Apple-style-span style=\"FONT-SIZE: 13px; FONT-FAMILY: Arial\"><SPAN lang=DE>The automatic cost generation function automatically generates all&nbsp;costs relevant to the optimizer (that is, the cost model)</SPAN><SPAN lang=DE>&nbsp; based on the business goals that&nbsp;you have defined.<SPAN class=Apple-converted-space>&nbsp;In particular, the system automatically generates the following cost terms and ignores their corresponding values in master data:</SPAN></SPAN></SPAN></SPAN></P><SPAN class=Apple-style-span style=\"WORD-SPACING: 0px; FONT: medium \'Times New Roman\'; TEXT-TRANSFORM: none; COLOR: rgb(0,0,0); TEXT-INDENT: 0px; WHITE-SPACE: normal; LETTER-SPACING: normal; BORDER-COLLAPSE: separate; orphans: 2; widows: 2; -webkit-border-horizontal-spacing: 0px; -webkit-border-vertical-spacing: 0px; -webkit-text-decorations-in-effect: none; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px\"><SPAN class=Apple-style-span style=\"FONT-SIZE: 13px; FONT-FAMILY: Arial\"><SPAN lang=DE><SPAN class=Apple-converted-space><SPAN class=Apple-style-span style=\"WORD-SPACING: 0px; FONT: medium \'Times New Roman\'; TEXT-TRANSFORM: none; COLOR: rgb(0,0,0); TEXT-INDENT: 0px; WHITE-SPACE: normal; LETTER-SPACING: normal; BORDER-COLLAPSE: separate; orphans: 2; widows: 2; -webkit-border-horizontal-spacing: 0px; -webkit-border-vertical-spacing: 0px; -webkit-text-decorations-in-effect: none; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px\">\r\n<P class=MsoListBullet style=\"FONT-SIZE: 10pt; MARGIN: 3pt 0in 3pt 28.1pt; TEXT-INDENT: -16.6pt; FONT-FAMILY: Arial\"><SPAN lang=DE style=\"FONT-FAMILY: Symbol\"><SPAN>·<SPAN style=\"FONT: 7pt \'Times New Roman\'\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<SPAN class=Apple-converted-space>&nbsp;</SPAN></SPAN></SPAN></SPAN><SPAN>Storage costs</SPAN></P>\r\n<P class=MsoListBullet style=\"FONT-SIZE: 10pt; MARGIN: 3pt 0in 3pt 28.1pt; TEXT-INDENT: -16.6pt; FONT-FAMILY: Arial\"><SPAN style=\"FONT-FAMILY: Symbol\"><SPAN>·<SPAN style=\"FONT: 7pt \'Times New Roman\'\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<SPAN class=Apple-converted-space>&nbsp;</SPAN></SPAN></SPAN></SPAN><SPAN>Production costs</SPAN></P>\r\n<P class=MsoListBullet style=\"FONT-SIZE: 10pt; MARGIN: 3pt 0in 3pt 28.1pt; TEXT-INDENT: -16.6pt; FONT-FAMILY: Arial\"><SPAN style=\"FONT-FAMILY: Symbol\"><SPAN>·<SPAN style=\"FONT: 7pt \'Times New Roman\'\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<SPAN class=Apple-converted-space>&nbsp;</SPAN></SPAN></SPAN></SPAN><SPAN>Product-specific transportation costs</SPAN></P>\r\n<P class=MsoListBullet style=\"FONT-SIZE: 10pt; MARGIN: 3pt 0in 3pt 28.1pt; TEXT-INDENT: -16.6pt; FONT-FAMILY: Arial\"><SPAN style=\"FONT-FAMILY: Symbol\"><SPAN>·<SPAN style=\"FONT: 7pt \'Times New Roman\'\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<SPAN class=Apple-converted-space>&nbsp;</SPAN></SPAN></SPAN></SPAN><SPAN>Procurement costs</SPAN></P>\r\n<P class=MsoListBullet style=\"FONT-SIZE: 10pt; MARGIN: 3pt 0in 3pt 28.1pt; TEXT-INDENT: -16.6pt; FONT-FAMILY: Arial\"><SPAN lang=DE style=\"FONT-FAMILY: Symbol\"><SPAN>·<SPAN style=\"FONT: 7pt \'Times New Roman\'\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<SPAN class=Apple-converted-space>&nbsp;</SPAN></SPAN></SPAN></SPAN><SPAN>Penalty costs for shortfall of safety stock</SPAN></P>\r\n<P class=MsoListBullet style=\"FONT-SIZE: 10pt; MARGIN: 3pt 0in 3pt 28.1pt; TEXT-INDENT: -16.6pt; FONT-FAMILY: Arial\"><SPAN style=\"FONT-FAMILY: Symbol\"><SPAN>·<SPAN style=\"FONT: 7pt \'Times New Roman\'\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<SPAN class=Apple-converted-space>&nbsp;</SPAN></SPAN></SPAN></SPAN><SPAN>Penalty costs for non-delivery</SPAN></P>\r\n<P class=MsoListBullet style=\"FONT-SIZE: 10pt; MARGIN: 3pt 0in 3pt 28.1pt; TEXT-INDENT: -16.6pt; FONT-FAMILY: Arial\"><SPAN style=\"FONT-FAMILY: Symbol\"><SPAN>·<SPAN style=\"FONT: 7pt \'Times New Roman\'\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<SPAN class=Apple-converted-space>&nbsp;</SPAN></SPAN></SPAN></SPAN><SPAN>Penalty costs for late delivery</SPAN></SPAN></SPAN></SPAN></SPAN></SPAN></P>\r\n<P><FONT color=#000000>Automatic cost generation option is a convenient&nbsp;feature especially when the&nbsp;defined cost terms in&nbsp;master data are not reliable. In such situations, automatic cost generation ensures that the costs are generated in a more consistent way, the model stays&nbsp;more coherent and the system&nbsp;performs in a more stable manner. </FONT></P></FONT></FONT></FONT></FONT></SPAN>',
